Available only in Georgia (Sakartvelo);
Download Now Wendy’s & DUNKIN’ Georgia mobile app! Place order, get lots of rewards and special offers!

From this app you can easily:

    • Place order ahead at preferred restaurant, while you are on the way and get your meal without standing in line. You can even schedule the order pickup time;
    • Get reward points on every purchase you made through this app at every Wendy’s & DUNKIN’ restaurant;
    • Exchange your reward points to various products which you can find in Wendy's & DUNKIN' gifts store;
    • Check-in daily and get different special offers tailored for you;
    • Add your best pick products under “Favorite” tab and order easily;

Enjoy hole new experience with Wendy’s & DUNKIN’ Georgia loyalty app and please do share your feedback. 

Note: Reward scheme is common for both brands. You can earn and exchange points from one another.
